Just discovered that Friday, May 19th is the 6 year anniversary of my favorite project i’ve ever done 💕 feels fitting to drop my biggest sale yet on this date. I’ve always said that I never want anyone to come to my shows for me - I want people to come for their own experience. This interactive exhibition gave people the space to interact and express themselves in a way that created a collaborative work that was unique to everyone that came to experience it. i LOVED creating this interactive exhibit my senior year of high school and hosting an EPIC opening. I’ve grown so much as an artist since, but the way this project brought people together is what makes it closest to what i ultimately want to do. 

Drop a comment if you were there…can’t believe it’s been 6 years already!!! 

